import React, { useState, useEffect } from "react";
import { Routes, Route, Navigate, Outlet, useLocation } from "react-router-dom";
import Navbar from "./components/Navbar";
import GuestHome from "./pages/Gust";
import ProductDetails from "./pages/ProductDetails";
import Cart from "./pages/Cart";
import Login from "./pages/Login";
import Wishlist from "./pages/Wishlist";
import Profile from "./pages/Profile";
import Checkout from "./pages/Checkout";
import Categories from "./pages/Categories";
import About from "./pages/About";
import Contact from "./pages/Contact";
import Footer from "./components/Footer";
import ScrollToTopButton from "./components/ScrollToTopButton";
import TenantDashboard from "./pages/TenantDashboard"; 
import LandlordDashboard from "./pages/LandlordDashboard"; 
import AdminDashboard from "./pages/AdminDashboard"; 
import AcceptPosts from "./pages/AcceptPosts";  
import AcceptRequests from "./pages/AcceptRequests"; 


const App = () => {
  const [cart, setCart] = useState([]);
  const location = useLocation();

  useEffect(() => {
    const storedCart = JSON.parse(localStorage.getItem("cart"));
    if (storedCart) setCart(storedCart);
  }, []);

  useEffect(() => {
    localStorage.setItem("cart", JSON.stringify(cart));
  }, [cart]);

  const isLoginPage = location.pathname === "/login" || location.pathname === "/register";

  return (
    <>
      {location.pathname !== "/login" && location.pathname !== "/register" && (
        <Navbar cart={cart} />
      )}

      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/guest" element={<GuestHome />} />
        <Route path="/product/:id" element={<ProductDetails />} />

        <Route element={<ProtectedRoute roles={["tenant", "landlord", "admin"]} />}>
          <Route path="/" element={<GuestHome />} />
          <Route path="/cart" element={<Cart cart={cart} setCart={setCart} />} />
          <Route path="/wishlist" element={<Wishlist />} />
          <Route path="/profile" element={<Profile />} />
          <Route path="/checkout" element={<Checkout />} />
          <Route path="/categories" element={<Categories cart={cart} setCart={setCart} />} />
        </Route>

        <Route element={<ProtectedRoute roles={["tenant"]} />}>
          <Route path="/tenant-dashboard" element={<TenantDashboard />} />
        </Route>

        <Route element={<ProtectedRoute roles={["landlord"]} />}>
          <Route path="/landlord-dashboard" element={<LandlordDashboard />} />
        </Route>

        <Route element={<ProtectedRoute roles={["admin"]} />}>
          <Route path="/admin-dashboard" element={<AdminDashboard />} />
          <Route path="/admin-dashboard/accept-users" element={<AcceptRequests />} />  
          <Route path="/admin-dashboard/accept-posts" element={<AcceptPosts />} />  
        </Route>

      </Routes>

      {!isLoginPage && <Footer />}

      <ScrollToTopButton />
    </>
  );
};

export default App;
